import React, { useMemo } from 'react';
import { 
  ScatterChart, Scatter, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, ReferenceLine, Cell, ReferenceArea
} from 'recharts';
import { questions } from '../data/questions';
import { calculateDimensionScore, getAttachmentStyle } from '../utils/scoring';
import './ResultPage.css';

// 定义象限背景色
const QUADRANT_COLORS = {
  secure: '#d0f0c0',      // 左下：安全型 (绿色系)
  anxious: '#ffe0b2',     // 右下：焦虑型 (橙色系)
  avoidant: '#bbdefb',    // 左上：回避型 (蓝色系)
  disorganized: '#f8bbd0' // 右上：恐惧型 (粉色系)
};

// 定义不同关系的点的颜色
const POINT_COLORS = {
  mother: '#d32f2f',   // 红色
  father: '#388e3c',   // 绿色
  partner: '#1976d2',  // 蓝色
  general: '#212121'   // 黑色
};

const ResultPage = ({ answers, onRestart }) => {

  // 计算所有部分的得分
  const results = useMemo(() => {
    const sections = questions.attachment.sections;
    const items = questions.attachment.items;

    return sections.map(section => {
      const sectionAnswers = {};
      items.forEach(item => {
        const uniqueId = `${section.id}_${item.id}`;
        if (answers[uniqueId] !== undefined) {
          sectionAnswers[item.id] = answers[uniqueId];
        }
      });

      const scores = calculateDimensionScore(sectionAnswers, items);
      const style = getAttachmentStyle(scores.anxiety, scores.avoidance);

      return {
        id: section.id,
        name: section.title_zh.replace('关系结构：', ''),
        anxiety: parseFloat(scores.anxiety),
        avoidance: parseFloat(scores.avoidance),
        attachmentType: style
      };
    });
  }, [answers]);

  // 图表数据：X轴为焦虑，Y轴为回避
  const chartData = results.map(r => ({
    id: r.id,
    x: r.anxiety,   // X Axis: Anxiety
    y: r.avoidance, // Y Axis: Avoidance
    name: r.name,
    attachmentType: r.attachmentType
  }));

  // 自定义 Tooltip
  const CustomTooltip = ({ active, payload }) => {
    if (active && payload && payload.length) {
      const data = payload[0].payload;
      return (
        <div className="custom-tooltip">
          <p className="label"><strong>{data.name}</strong></p>
          <p>焦虑 (Anxiety): {data.x}</p>
          <p>回避 (Avoidance): {data.y}</p>
          <p>类型: {data.attachmentType}</p>
        </div>
      );
    }
    return null;
  };

  return (
    <div className="result-container">
      <div className="result-header">
        <h2>您的依恋类型测试结果</h2>
        <p>基于 ECR-RS 关系结构问卷分析</p>
      </div>

      <div className="chart-container">
        <ResponsiveContainer width="100%" height="100%">
          <ScatterChart margin={{ top: 20, right: 20, bottom: 20, left: 20 }}>
            <CartesianGrid strokeDasharray="3 3" />

            <XAxis 
              type="number" 
              dataKey="x" 
              name="焦虑" 
              domain={[1, 7]} 
              label={{ value: '焦虑维度 (Anxiety)', position: 'bottom', offset: 0 }} 
            />
            <YAxis 
              type="number" 
              dataKey="y" 
              name="回避" 
              domain={[1, 7]} 
              label={{ value: '回避维度 (Avoidance)', angle: -90, position: 'left' }} 
            />

            <Tooltip content={<CustomTooltip />} />

            {/* 
              绘制四个象限背景 
              X轴: 焦虑 (1-7), Y轴: 回避 (1-7)
              中点: 4
            */}

            {/* 左上: Avoidant (低焦虑, 高回避) -> x: 1-4, y: 4-7 */}
            <ReferenceArea 
              x1={1} x2={4} y1={4} y2={7} 
              fill={QUADRANT_COLORS.avoidant} fillOpacity={0.4} 
            >
              <Label value="回避型 (Avoidant)" position="center" fill="#1565c0" fontSize={14} fontWeight="bold" />
            </ReferenceArea>

            {/* 右上: Disorganized (高焦虑, 高回避) -> x: 4-7, y: 4-7 */}
            <ReferenceArea 
              x1={4} x2={7} y1={4} y2={7} 
              fill={QUADRANT_COLORS.disorganized} fillOpacity={0.4}
            >
              <Label value="恐惧/混乱型 (Disorganized)" position="center" fill="#c62828" fontSize={14} fontWeight="bold" />
            </ReferenceArea>

            {/* 左下: Secure (低焦虑, 低回避) -> x: 1-4, y: 1-4 */}
            <ReferenceArea 
              x1={1} x2={4} y1={1} y2={4} 
              fill={QUADRANT_COLORS.secure} fillOpacity={0.4}
            >
              <Label value="安全型 (Secure)" position="center" fill="#2e7d32" fontSize={14} fontWeight="bold" />
            </ReferenceArea>

            {/* 右下: Anxious (高焦虑, 低回避) -> x: 4-7, y: 1-4 */}
            <ReferenceArea 
              x1={4} x2={7} y1={1} y2={4} 
              fill={QUADRANT_COLORS.anxious} fillOpacity={0.4}
            >
              <Label value="焦虑型 (Anxious)" position="center" fill="#ef6c00" fontSize={14} fontWeight="bold" />
            </ReferenceArea>

            {/* 中心分割线 */}
            <ReferenceLine x={4} stroke="#666" strokeWidth={1} />
            <ReferenceLine y={4} stroke="#666" strokeWidth={1} />

            {/* 数据点 */}
            <Scatter name="Results" data={chartData}>
              {chartData.map((entry, index) => (
                <Cell key={`cell-${index}`} fill={POINT_COLORS[entry.id] || '#000'} />
              ))}
            </Scatter>
          </ScatterChart>
        </ResponsiveContainer>
      </div>

      {/* 结果详情列表 (仿照截图样式) */}
      <div className="result-details-list">
        <h3>详细得分</h3>
        <div className="score-list">
          {results.map(r => (
            <div key={r.id} className="score-item">
              <div className="score-item-header">
                <span 
                  className="color-dot" 
                  style={{ backgroundColor: POINT_COLORS[r.id] || '#000' }}
                ></span>
                <span className="score-name">{r.name}</span>
              </div>
              <div className="score-values">
                <span>焦虑: <strong>{r.anxiety}</strong></span>
                <span className="divider">|</span>
                <span>回避: <strong>{r.avoidance}</strong></span>
              </div>
              <div className="score-type">
                {r.attachmentType}
              </div>
            </div>
          ))}
        </div>
      </div>

      <button className="restart-btn" onClick={onRestart}>
        重新测试
      </button>
    </div>
  );
};

export default ResultPage;
